import pytest
from image_processor.image import Image


class TestImageClass:
    def test_instance_with_path(self):
        Image(path="data/photo_1.jpg")

    def test_instance_with_base64(self):
        Image(base64="1234")

    def test_instance_with_bytes(self):
        Image(bytes=[123, 123, 123])

    def test_instance_with_no_argument(self):
        with pytest.raises(Exception):
            Image()

    def test_get_bytes(self):
        image = Image(bytes=[123, 123, 123])
        bytes = image.get_bytes()

        assert len(bytes) == 3

    def test_get_bytes_from_path(self):
        image = Image(path="data/photo_1.jpg")
        bytes = image.get_bytes()

        assert len(bytes) > 0

    def test_get_bytes_from_base64(self):
        image = Image(
            base64="data:image/jpeg;base64,"
        )
        bytes = image.get_bytes()

        assert len(bytes) > 0
